LP_BATTLELOG_2:"O aplicativo Battlelog possui muitos dos recursos disponíveis no site Battlelog.com, todos aprimorados para telas menores e de toque. Você pode usá-lo enquanto estiver jogando ou quando estiver em outro lugar.",ID_MOBILE_HELP_BATTLELOG_3:"Lembre-se de que algumas configurações de segurança do Wi-Fi podem permitir a conexão, mas não o uso de certos recursos de rede do aplicativo.",ID_MOBILE_HELP_CAMPAIGN_1:"Veja o quão longe você chegou na Campanha para um jogador do Battlefield 4 e descubra sua posição em relação aos seus Amigos. Na página de Campanha, você encontrará um resumo detalhado das designações e dos colecionáveis que podem ser concluídos ou encontrados, e descobrirá quem é o melhor entre seus Amigos.",ID_MOBILE_HELP_COMCENTER_1:"Com o Centro de Comunicações, você pode descobrir o que seus Amigos estão fazendo. Para acessá-lo, clique no botão de Amigos no canto superior direito ou deslize o dedo para a esquerda na tela. Isso listará todos os seus Amigos e o que cada um está fazendo.",ID_MOBILE_HELP_COMCENTER_2:"Se um Amigo estiver jogando o modo Multijogador do Battlefield 4 na mesma plataforma que o seu soldado ativo e você estiver online no jogo, será possível juntar-se ao seu Amigo. Basta clicar no botão Entrar próximo a ele.",ID_MOBILE_HELP_FORUMS_1:"Junte-se aos jogadores aficionados nos fóruns do Battlefield. Crie um novo tópico em uma das seções para começar uma nova discussão ou publique uma resposta em um tópico existente para não deixar que ele caia no esquecimento.",ID_MOBILE_HELP_HEAD_ACTIVESOLDIER:bn,ID_MOBILE_HELP_HEAD_BATTLELOG:Po,ID_MOBILE_HELP_HEAD_CAMPAIGN:It,ID_MOBILE_HELP_HEAD_COMCENTER:"Centro de Comunicações e amigos",ID_MOBILE_HELP_HEAD_FORUMS:ds,ID_MOBILE_HELP_HEAD_HOME:"Início",ID_MOBILE_HELP_HEAD_LEADERBOARDS:"Placares de Líderes geográficos",ID_MOBILE_HELP_HEAD_LOADOUT:"Configuração em tempo real",ID_MOBILE_HELP_HEAD_LOGIN:"Conectando-se",ID_MOBILE_HELP_HEAD_MISSIONS:$n,ID_MOBILE_HELP_HEAD_MULTIPLAYER:"Multiplayer e entrada remota",ID_MOBILE_HELP_HEAD_NAVIGATION:"Menu e navegação",ID_MOBILE_HELP_HEAD_NEWS:Gr,ID_MOBILE_HELP_HEAD_PROFILE:zt,ID_MOBILE_HELP_HEAD_PUSH:"Notificações de push",ID_MOBILE_HELP_HEAD_REPORTS:"Relatórios de batalha",ID_MOBILE_HELP_HEAD_STATS:"Soldados e estatísticas",ID_MOBILE_HELP_HEAD_UGM:"Gerenciador de jogo unificado",ID_MOBILE_HELP_HOME_1:"Ao acessar o aplicativo Battlelog, você verá a tela de Início, que mostra uma visão geral das novidades no mundo de Battlefield. Confira as últimas histórias, veja como está a progressão do seu soldado, dos desbloqueios e das sugestões e descubra o que seus Amigos andam fazendo no feed de batalha.",ID_MOBILE_HELP_LEADERBOARDS_1:"Agora você pode competir com jogadores de Battlefield 4 não apenas do mundo, mas também do seu país e até da sua cidade. Escolha o seu local e tente se tornar o melhor da região, subindo nos Placares de Líderes da 10ª até a 1ª divisão!",ID_MOBILE_HELP_LEADERBOARDS_2:"Não é obrigatório indicar um local. Você pode escolher qualquer lugar no mapa-múndi.",ID_MOBILE_HELP_LOADOUT_1:"Você pode personalizar a configuração de armas, acessórios, dispositivos e veículos do seu soldado a qualquer momento usando o aplicativo Battlelog. Basta acessar a Configuração no menu do soldado ou no Gerenciador de jogo unificado, selecionar seus equipamentos e clicar em “Salvar” para atualizá-la instantaneamente, mesmo se você não estiver jogando. Da próxima vez que se posicionar, sua nova Configuração estará com você.",ID_MOBILE_HELP_LOGIN_1:"Para se conectar ao Battlelog, é preciso usar o endereço de e-mail e a senha da sua Conta Origin. Se estiver jogando em um console, será preciso entrar com a Conta Origin que você usou da primeira vez em que jogou. Você pode encontrar este endereço de e-mail abrindo o Battlelog no jogo.",ID_MOBILE_HELP_LOGIN_2:"Você também pode se conectar usando um código QR, basta abrir o Battlelog do jogo no PC, Xbox One ou sistema PlayStation®4. Digitalize o código QR, faça a verificação com o código de 4 dígitos e pronto! Você será conectado automaticamente.",ID_MOBILE_HELP_LOGIN_3:"Acesse www.Origin.com caso precise de ajuda para se conectar ou recuperar sua senha. Lá, você também poderá registrar uma Conta Origin.",ID_MOBILE_HELP_MISSIONS_1:"Jogue contra seus Amigos em Missões e descubra quem é o melhor no Battlefield 4. Crie uma nova Missão escolhendo um objetivo, como maior número de eliminações ou de Dog Tags tomadas, e convide seus Amigos. O vencedor será o jogador com a maior pontuação após o término de todas as tentativas ou quando acabar o tempo.",ID_MOBILE_HELP_MULTIPLAYER_1:"Sempre que estiver conectado ao Battlelog no Battlefield 4, você poderá se juntar remotamente a servidores ou a Amigos através do aplicativo Battlelog. Basta encontrar um servidor ao seu gosto, certificar-se de que o gerenciador de jogo unificado esteja sendo exibido e clicar no botão “Entrar” para mudar instantaneamente de servidor no seu PC ou console.",ID_MOBILE_HELP_NAVIGATION_1:"O principal jeito de navegar no aplicativo Battlelog é pelo menu. Para abri-lo, toque no botão de menu no canto superior esquerdo ou deslize seu dedo para a direita na tela. Lá, você encontrará as principais seções do aplicativo.",ID_MOBILE_HELP_NEWS_1:"Fique por dentro de tudo o que está acontecendo no mundo de Battlefield. Na seção de notícias, você terá acesso às últimas informações e poderá conversar sobre acontecimentos com outros jogadores, seja escrevendo ou respondendo comentários.",ID_MOBILE_HELP_PROFILE_1:"Seu perfil se estende por todo o Battlelog, incluindo todos os soldados e jogos que sejam compatíveis com ele. Aqui, você pode gerenciar seus Amigos, consultar a sua lista de soldados e acompanhar o feed de batalha, onde é possível publicar atualizações e comentários nas atividades dos seus Amigos.",ID_MOBILE_HELP_PUSH_1:"Ao ativar as notificações de push do aplicativo Battlelog, você será informado mesmo quando não estiver jogando. As notificações incluem atualizações de Missões, avisos do feed de batalha e pedidos de Amigo.",ID_MOBILE_HELP_REPORTS_1:"Use os relatórios de batalha para ver como você e sua equipe se saíram nos últimos jogos. É possível conferir seu desempenho e de todos os outros jogadores da rodada para ter uma visão detalhada de o que aconteceu na partida. Se você for um jogador Premium, poderá salvar o relatório de batalha como favorito e publicá-lo no seu feed de batalha para causar inveja aos outros.",ID_MOBILE_HELP_STATS_1:"Acompanhe todos os detalhes da carreira do seu soldado com nosso abrangente sistema de estatísticas. Na página de soldado, você encontrará tudo de que precisa, desde uma visão geral das patentes, habilidades e pontuações, a estatísticas detalhadas sobre cada arma e veículo. Também é possível ver quanto do jogo você concluiu ou desbloqueou, além de rastrear itens novos."
